From Wikipedia:

The Beatles at the Hollywood Bowl is a live album released in May 1977 featuring songs by The Beatles compiled from two live performances at the Hollywood Bowl during August 1964 and August 1965.[3] The album was released by Capitol Records in the United States and Canada and on Parlophone in the United Kingdom.
In New Zealand it was to be pressed and released locally with the catalogue number PCS 6130 (the 6000 series was designated for EMI (NZ) only releases), but this did not occur. Instead New Zealand pressed this record and used the Australian catalogue number PCSO 7577. The album has never been officially released on CD.

